import React, { Component } from 'react';
import PokemonList from '../pokemon/pokemonList';

export default class DashBoard extends Component {
    render() {
        return (
            <div className ="row">
                <div className="col">
                    <PokemonList/>
                    <PokemonList/>
                    <PokemonList/>
                    <PokemonList/>
                    <PokemonList/>
                </div>
            </div>
        )
    }
}
